async function () {
  let userInfo = await appsmith.store.user;
  if (userInfo) {
    const agencyId = JSON.stringify(userInfo.agency_id);
    await find_service_allowed.run({
      agencyId
    }).then(res => form.serviceAllowed = JSON.stringify(res[0].service_type_codes)).catch(e => {
      showAlert("Can not retrieve service type code. " + e.message, 'error');
    });
    form.isWifiAllowed = form.serviceAllowed.includes('wifi');
    form.isCardAllowed = form.serviceAllowed.includes('credit_card');
    form.isUtilitiesAllowed = form.serviceAllowed.includes('utility');
    service_wifi_cb.setVisibility(form.isWifiAllowed);
    service_card_cb.setVisibility(form.isCardAllowed);
    service_utilities_cb.setVisibility(form.isUtilitiesAllowed);
  } else {
    showAlert("Can not retrieve user info. ", 'error');
  }
}
